import './App.css';
import img1 from './man.jpg';
import img2 from './shopping.jpg';

function App() {
  return (
    <div className="App">
      <img src={ img2 } alt='shopping' width="300px"/>
      <h1>Grocery list</h1>
      <img src={ img1} alt='man' width="300px"/>
    </div>
  );
}

export default App;
